export declare const searchFarcasterUsersQuery = "\n  query SearchFarcasterUsers($profileName: String!, $limit: Int = 200) {\n    Socials(\n      input: {\n        filter: {\n          profileName: { _regex: $profileName }\n          dappName: { _eq: farcaster }\n        }\n        blockchain: ethereum\n        order: { followerCount: DESC }\n        limit: $limit\n      }\n    ) {\n      Social {\n        profileName\n        fid: userId\n        fnames\n        profileImageContentValue {\n          image {\n            extraSmall\n            small\n            medium\n            large\n            original\n          }\n        }\n        custodyAddress: userAddress\n        connectedAddresses {\n          address\n          blockchain\n          chainId\n          timestamp\n        }\n        userAssociatedAddresses\n        followerCount\n        followingCount\n      }\n    }\n  }\n";
